	[/script]

	[script]
	id="dialog_2"
		[modification]
		on_process="[end_script(), speech_dialog(self, set(level.zoom, 2), music('MilgramSwagger.ogg'),
									[~A moment of your time sir?~],
									set(level.player.animation, 'emote_geez'),
									level.player, [~Sorry, I'm off to town!\nNot interested!~],
									self, [~But the town, you see ...~],
									set(level.player.animation, 'emote_oh'),
									level.player, [~Not. Interested.\nBuzz off.~],
									set(level.player.animation, 'emote_geez'),
									level.player, [~I don't care what you're preaching,\ngo sell it to someone else.~],
									self, [~Very well.~],
									facing(1),animation('fly_up'),
									set(level.player.animation, 'emote_raisedfinger'),
									level.player, [~Someday, those door-to-door people\nwill realize that kind of hard-sell tactic\njust annoys people.~],
									set(level.player.animation, 'emote_geez'),
									level.player, [~The sooner, the better.~],
									music('FrogattoChill.ogg'), set(level.zoom, 1),
									set(level.player.vars.triggered_events, level.player.vars.triggered_events + ['berds-first-speech']))]"
		target="get_object(level,'berd_man')"
		[/modification]

	[/script]

